import React from "react";
import "./Style.css";
import Logo from "./Logo";
const Login = () => {
  return (
    <section>
      <Logo />
      <div>Login page</div>
      <table>
        <thead>
          <td>Login Username</td>
          <td>
            <input type="text" />
          </td>
        </thead>
        <tbody>
          <td>password</td>
          <td>
            <input type="password" />
          </td>
        </tbody>
      </table>
      <button>Login</button>
    </section>
  );
};
export default Login;
